INSERT INTO `sensor_type` VALUES (1,'DS18B20','O DS18B20 é um sensor digital de temperatura fabricado pela Maxim IC com range de -55ºC a 125ºC e precisão de meio grau (+/-0.5ºC). Sua ligação se dá com apenas um fio (Onewire) além da alimentação (GND e Vin). \r\nSe trata de um dispositivo bem pequeno, logo é conveniente usar uma placa adaptadora (breakaout board) quando se trabalha com protótipo.\r\nO protocolo Onewire exige ligação a uma porta digital do Arduino.\r\nDatasheet: http://datasheets.maxim-ic.com/en/ds/DS18B20.pdf','ds18b20.jpg'),(2,'HSG-20','Sensor de umidade relativa do ar analógico\r\nO HG …. \r\nEsse dispositivo relata a umidade relativa do ar na forma de uma variação de tensão elétrica. Logo sua ligação será feita a uma porta analógica do Arduino, além da necessária alimentação elétrica de 5V\r\nTal dispositivo também é capaz de medir a temperatura, também de forma analógica. Se utilizará apenas o pino relativo à umidade.\r\nColetado o nível de tensão, se procede aos cálculos necessários e se chega à umidade relativa do ar.','hsg-20.jpg'),(3,'BMP180','Fabricado pela Bosch, o BMP180 é um barômetro digital de alta precisão e de baixo consumo de energia. Seu range de medição vai de 300 a 1100 hPa, com uma precisão de 0.02 hPa. Já vem calibrado de fábrica e pode medir também temperatura, porém com uma precisão baixa (+/-2ºC). Seu interfaceamento com microcontrolador é feito via bus I2C. Assim, as ligações se limitam à alimentação (GND e Vin) e o bus de dados (SDA e SCL), pinos analógicos A4 e A5, respectivamente, no Arduino.\r\nAtenção redobrada ao se utilizar esse sensor, pois sua alimentação deve se restringir aos limites de1.8V a 3.6V, o que não é um problema pois o Arduino possui uma conveniente fonte de 3.3V. O fato dele operar com alimentação em 3.3V em nada dificulta a operação dos níveis lógicos dos pinos SDA e SCL. \r\nO dispositivo utilizado está montado numa breakout board, facilitando o acesso às conexões do sensor.\r\nDatasheet: http://cdn.sparkfun.com/datasheets/Sensors/Pressure/BMP180.pdf','bmp180.jpg');
